import React from "react";
import { StyleSheet, SafeAreaView, View, Text, TouchableOpacity, TextInput } from "react-native";
import { StatusBar } from "expo-status-bar";
import { FontAwesome5 } from "@expo/vector-icons";
import Constants from "expo-constants";

export default function MomoLogin() {
  return (
    <SafeAreaView style={styles.container}>
      <StatusBar style="light" />
      <View style={styles.content}>
        <View style={styles.textWrapper}>
          <Text style={styles.hiText}>VESNA</Text>
          <Text style={styles.userText}>Versatile Simulator for Near-zero Emissions Agriculture</Text>
          <Text style={styles.userText}>UIAM STU BA</Text>
        </View>
        <View style={styles.form}>
          <TextInput
            style={[styles.input, styles.inputUsername]}
            placeholder="Số điện thoại hoặc email"
            placeholderTextColor="#cdcdcf"
          />
          <FontAwesome5 name="lock" style={styles.iconLock} />
          <TextInput
            style={styles.inputPassword}
            keyboardType="numeric"
            secureTextEntry={true}
            autoFocus={true}
            placeholder="Password"
            placeholderTextColor="#929292"
          />
          <TouchableOpacity style={styles.buttonLogin}>
            <Text style={styles.buttonLoginText}>Login</Text>
          </TouchableOpacity>
        </View>
        <View style={styles.action1}>
          <TouchableOpacity>
            <Text style={styles.userText}>Forgot possword...</Text>
          </TouchableOpacity>
        </View>
        <View style={styles.action2}>
          <TouchableOpacity>
            <Text style={styles.userText}>No account? Register here!</Text>
          </TouchableOpacity>
        </View>
      </View>
    </SafeAreaView>
  );
}

const TEXT = {
  color: "#fff",
  textAlign: "center",
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#b0006d",
    paddingTop: Constants.statusBarHeight,
  },
  content: {
    paddingHorizontal: 30,
  },
  textWrapper: {
    marginTop: 60,
    marginBottom: 30,
  },
  hiText: {
    ...TEXT,
    fontSize: 20,
    lineHeight: 50,
    fontWeight: "bold",
  },
  userText: {
    ...TEXT,
    fontSize: 16,
    lineHeight: 30,
  },
  form: {
    marginBottom: 30,
  },
  iconLock: {
    color: "#929292",
    position: "absolute",
    fontSize: 16,
    top: 22,
    left: 22,
    zIndex: 10,
  },
  inputPassword: {
    height: 60,
    borderRadius: 30,
    paddingHorizontal: 30,
    fontSize: 20,
    color: "#929292",
    backgroundColor: "#fff",
    textAlign: "center",
    textAlignVertical: "center",
  },
  buttonLogin: {
    height: 50,
    borderRadius: 25,
    backgroundColor: "#8d015a",
    justifyContent: "center",
    marginTop: 15,
  },
  buttonLoginText: {
    ...TEXT,
  },
  action1: {
    textAlign: "center",
    textAlignVertical: "center",
  },
  action2: {
    textAlign: "center",
    textAlignVertical: "center",
  },
  input: {
    borderWidth: 1,
    borderColor: "#cdcdcf",
    color: "#333333",
    fontSize: 16,
    height: 44,
    paddingHorizontal: 15,
  },
  inputUsername: {
    borderBottomWidth: 0,
    borderTopLeftRadius: 3,
    borderTopRightRadius: 3,
  },
});
